function firstSundayOfMonth(year, month) {
    const firstDay = new Date(year, month - 1, 1);
    const dayOfWeek = firstDay.getDay();
    const daysUntilSunday = (7 - dayOfWeek) % 7;
    firstDay.setDate(firstDay.getDate() + daysUntilSunday);
    return firstDay;
}

// Funkcja pomocnicza - zbieranie wydatków do pierwszej niedzieli miesiąca
function collectExpensesToFirstSunday(expenses, year, month, firstSunday) {
    let allExpenses = [];
    for (const day in expenses[month]) {
        const dayDate = new Date(year, month - 1, Number(day));
        if (dayDate <= firstSunday) {
            for (const category in expenses[month][day]) {
                allExpenses.push(...expenses[month][day][category]);
            }
        }
    }
    return allExpenses;
}

// Funkcja rozwiązania nieoptymalizowanego
function solution1(expenses) {
    const result = {};
    for (const month in expenses) {
        const [year, monthNum] = month.split('-').map(Number);
        const firstSunday = firstSundayOfMonth(year, monthNum);
        const allExpenses = collectExpensesToFirstSunday(expenses, year, month, firstSunday);

        allExpenses.sort((a, b) => a - b);
        const n = allExpenses.length;
        result[month] = (n === 0)
            ? null
            : (n % 2 === 1)
                ? allExpenses[Math.floor(n / 2)]
                : (allExpenses[n / 2 - 1] + allExpenses[n / 2]) / 2;
    }
    return result;
}

// Funkcja rozwiązania zoptymalizowanego
function solution2(expenses) {
    const result = {};
    for (const month in expenses) {
        const [year, monthNum] = month.split('-').map(Number);
        const firstSunday = firstSundayOfMonth(year, monthNum);
        const allExpenses = collectExpensesToFirstSunday(expenses, year, month, firstSunday);

        const n = allExpenses.length;
        if (n === 0) {
            result[month] = null;
        } else if (n % 2 === 1) {
            result[month] = quickSelect(allExpenses, Math.floor(n / 2));
        } else {
            const median1 = quickSelect(allExpenses, Math.floor(n / 2) - 1);
            const median2 = quickSelect(allExpenses, Math.floor(n / 2));
            result[month] = (median1 + median2) / 2;
        }
    }
    return result;
}

